                //Document writes on back/forward button is causing duplicate field errors. Hence moving code in the script into a function.
                //ACCSEO-200 Accessibility for image - hear the text equivalent of the purpose of the widget
                (function(){
                    const productName = 'ACANA Red Meat Formula Grain-Free Dry Dog Food';
                    const thumbs = document.querySelectorAll('#media-selector img, #media-selector .trigger-video .cw-visually-hidden');
                    for (let i = 0; i < thumbs.length; i++) {
                        const text = productName + ', slide ' + (i + 1) + ' of ' + thumbs.length;
                        thumbs[i].parentElement.onmouseover = function() { setHeroAltText(text); };

                        let trim = text;
                        if (i !== 0) trim = trim.replace(productName + ', s', 'S');
                        if (thumbs[i].tagName === 'IMG') thumbs[i].setAttribute('alt', trim);
                        else thumbs[i].innerHTML = 'video, ' + trim;
                    }

                    let altTextTimeout;
                    function setHeroAltText(text) {
                        if (altTextTimeout) clearTimeout(altTextTimeout);
                            altTextTimeout = setTimeout(function () {
                            const heroImg = document.querySelector('.mz-figure > img');
                            if (heroImg) heroImg.setAttribute('alt', text);
                                else setHeroAltText(text);
                            }, 250);
                    }
                    setHeroAltText(productName + ', slide 1 of ' + thumbs.length);
                })();












